import {useState} from "react";
import {BaseResponse} from "../interfaces";

export function CheckUser() {
    const [form, setForm] = useState({
        name: "",
        age: "",
        married: "",
        dateOfBirth: ""
    });

    const [result, setResult] = useState<BaseResponse | null>(null);

    function update(field: string, value: string) {
        setForm((f) => ({...f, [field]: value}));
    }

    function submit() {
        setResult(null);

        fetch("http://localhost:3001/info/validate-details", {
            method: "POST",
            headers: {"Content-Type": "application/json"},
            body: JSON.stringify({
                name: form.name,
                age: Number(form.age),
                married: form.married === "" ? undefined : form.married === "yes",
                dateOfBirth: form.dateOfBirth
            })
        })
            .then((res) => res.json())
            .then((json) => setResult(json));
    }

    return (
        <div style={styles.container}>
            <h1 style={styles.title}>Check User Details</h1>

            <div style={styles.card}>
                <div style={styles.field}>
                    <label style={styles.label}>Name</label>
                    <input
                        style={styles.input}
                        value={form.name}
                        placeholder="Enter full name"
                        onChange={(e) => update("name", e.target.value)}
                    />
                </div>

                <div style={styles.field}>
                    <label style={styles.label}>Age</label>
                    <input
                        type="number"
                        style={styles.input}
                        value={form.age}
                        placeholder="Age"
                        onChange={(e) => update("age", e.target.value)}
                    />
                </div>

                <div style={styles.field}>
                    <label style={styles.label}>Married</label>
                    <select
                        style={styles.input}
                        value={form.married}
                        onChange={(e) => update("married", e.target.value)}
                    >
                        <option value="">-- select --</option>
                        <option value="yes">Yes</option>
                        <option value="no">No</option>
                    </select>
                </div>

                <div style={styles.field}>
                    <label style={styles.label}>Date of Birth</label>
                    <input
                        type="date"
                        style={styles.input}
                        value={form.dateOfBirth}
                        onChange={(e) => update("dateOfBirth", e.target.value)}
                    />
                </div>

                <button style={styles.button} onClick={submit}>
                    Validate
                </button>
            </div>

            {result && (
                <div
                    style={{
                        ...styles.resultBox,
                        borderLeft: result.success ? "5px solid #28a745" : "5px solid #dc3545",
                    }}
                >
                    <h3
                        style={{
                            ...styles.resultTitle,
                            color: result.success ? "#28a745" : "#dc3545",
                        }}
                    >
                        {result.success ? "Validation Successful" : "Validation Errors"}
                    </h3>

                    {!result.success && result.errors && (
                        <ul style={{ paddingLeft: "20px", color: "#dc3545" }}>
                            {result.errors.map((err, idx) => (
                                <li key={idx} style={{ marginBottom: "4px" }}>
                                    <strong>{err.property}</strong>:{" "}
                                    {err.constraints && Object.values(err.constraints).join(", ")}
                                </li>
                            ))}
                        </ul>
                    )}

                    {result.success && (
                        <div style={{ color: "#28a745", fontWeight: "bold" }}>
                            âœ“ All fields are valid.
                        </div>
                    )}

                    <details style={{ marginTop: "10px" }}>
                        <summary style={{ cursor: "pointer" }}>Show raw response</summary>
                        <pre style={styles.pre}>{JSON.stringify(result, null, 2)}</pre>
                    </details>
                </div>
            )}

        </div>
    );
}

const styles: { [key: string]: React.CSSProperties } = {
    container: {
        padding: "20px",
        maxWidth: "700px",
        margin: "0 auto",
        fontFamily: "Arial, sans-serif"
    },
    title: {
        marginBottom: "20px",
        fontSize: "28px",
        textAlign: "center"
    },
    card: {
        background: "#f9f9f9",
        padding: "20px",
        borderRadius: "8px",
        boxShadow: "0 2px 6px rgba(0,0,0,0.1)"
    },
    field: {
        marginBottom: "15px"
    },
    label: {
        display: "block",
        marginBottom: "5px",
        fontWeight: "bold"
    },
    input: {
        width: "100%",
        padding: "10px",
        borderRadius: "4px",
        border: "1px solid #ccc",
        fontSize: "16px"
    },
    button: {
        width: "100%",
        padding: "12px",
        background: "#007bff",
        color: "white",
        fontSize: "16px",
        border: "none",
        borderRadius: "5px",
        cursor: "pointer",
        marginTop: "10px"
    },
    resultBox: {
        marginTop: "25px",
        background: "#fff",
        padding: "20px",
        borderRadius: "8px",
        border: "1px solid #ddd"
    },
    resultTitle: {
        margin: "0 0 10px 0"
    },
    pre: {
        background: "#f0f0f0",
        padding: "15px",
        borderRadius: "6px",
        overflowX: "auto"
    }
};
